import React from 'react'


function TaskCard (props) {
    return (
        <div className="task">
            <div className="label">{props.task.category}</div>
            <div className="text">{props.task.text}</div>
            <button class="delete" onClick={props.delete}>X</button>
        </div>
    )
}

export default TaskCard
